import React, { useEffect, useState } from 'react';
import searchCSS from '../home_genre_playlist.module.css';
import search from '../assets/search.png';

function SearchBar (props){

    return (
        <div className={searchCSS.searchBox}>
            <input className = {searchCSS.searchInput} value={props.value} onChange={props.onChange} type='text' placeholder="What's on your mind? Artists/Songs" />
            <button className = {searchCSS.searchButton} onClick=''><img className = {searchCSS.searchImg} src={search}/></button>
            <ul>
                {props.data.map(item=>{
                    return (
                        <li>{item.props.data}</li>
                    )
                })}
            </ul>
        </div>
    )
}

export default SearchBar;
